import React from 'react';
import './App.css';

import HeaderTitle from './Components/headerTitle.js';
import Header from './Components/header.js';
import Posteo from './Components/postImg.js';
import Footer from './Components/footer.js';


function App() {
  return (
    <div className="App">

      <HeaderTitle/>
      <Header/>
      <Posteo/>
      <Posteo/>
      <Posteo/>
      <Footer/>
    </div>
  );
}

export default App;
